import React, { Component } from 'react';
import styles from './Start.module.css';
import photo from '.cabin.png'
export default class Start extends Component {
    render() {
        return (
            <div className={styles.test}>
            <img src={photo} alt="photo"  />
            </div>
        )
    }
}
